__NUXT_JSONP__("/svet/stat/namibie", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E,F,G,H,I,J,K,L,M,N,O,P,Q){return {data:[{tabsLoad:{tabWhatToSee:b,tabPrice:b,tabPeople:b,tabTrip:b,tabContact:b,tabHotel:b,tabNeighboring:t,tabVideos:i,tabArticles:i,tabWallSockets:u,tabChains:m,tabFauna:i,tabFlora:i,tabFoods:t,tabBrands:i},place:[{tld:".na",name:"Namibie",area:825418,population:2540905,slug:v,id_continent:h,information_chatgpt:"\u003Cp\u003ENamibie je země ležící v jihozápadní Africe, s rozlohou přes 800 000 km² a s populací přibližně 2,5 milionu obyvatel. Hlavním městem Namibie je Windhoek.\u003C\u002Fp\u003E\n\u003Cp\u003ENamibie je známá svými ohromujícími přírodními krásami, zahrnujícími pouště, národní parky, útesy a pláže. Mezi nejpopulárnější turistické atrakce patří národní park Etosha, kde je možné pozorovat velkou divokou zvěř, jako jsou sloni, lvi a nosorožci. Dále zde lze navštívit horský masiv Brandberg, kde se nachází nejvyšší hora Namibie a mnoho skalních maleb a rytin, které jsou zdejšími kulturami staré přes 2 000 let. \u003C\u002Fp\u003E\n\u003Cp\u003ENamibie je také domovem mnoha etnických skupin, z nichž největší je Owambo. Země má 13 oficiálních jazyků, mezi nimiž patří angličtina, němčina a různé bantuské jazyky. Místní kuchyně je ovlivněna sousední Jihoafrickou republikou a zahrnuje pokrmy z masa, ryb a zeleniny, jako jsou bobotie, biltong a braai. \u003C\u002Fp\u003E\n\u003Cp\u003ENamibie je také bohatá na nerostné suroviny, včetně diamantů, mědi a uranu. Země má také stabilní politickou situaci a relativně vysokou úroveň hospodářského růstu. Navzdory tomu však Namibie stále čelí mnoha sociálním a ekonomickým výzvám, jako je vysoká nezaměstnanost a chudoba, zejména v zemědělských oblastech.\u003C\u002Fp\u003E\n\u003Cp\u003EPro turisty, kteří hledají krásné přírodní scenérie, kulturní zážitky a ochutnávky místní kuchyně, je Namibie skvělou volbou.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:12.5,date_update:c},{name:"Hlavní jídlo",value:70,date_update:c},{name:"Chleba",value:n,date_update:c},{name:"Mléko",value:o,date_update:c},{name:"Voda (500ml)",value:6,date_update:c},{name:"Espresso",value:p,date_update:c},{name:"Zmrzlina (jeden kopeček)",value:o,date_update:c},{name:"Pivo",value:14,date_update:c},{name:"Krabička cigaret",value:q,date_update:c},{name:"Bic Mac",value:a,date_update:c},{name:"Coca Cola (500ml)",value:n,date_update:c}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:w,date_update:d},{name:"Policie",value:"10111",date_update:d},{name:"Hasiči",value:w,date_update:d},{name:"Zdravotnická záchranná služba",value:"10177",date_update:d}],phone_prefix:"+264",coordinates:[{latitude:"-22.95764",longitude:"18.49041"}],people_religion:[{name:"Křesťanství",value:"93 %"},{name:"Tradiční africká náboženství",value:x},{name:"Jiná náboženství",value:y}],people_nationality:[{name:"Ovambové",value:"50 %"},{name:"Kavangové",value:"9 %"},{name:"Hererové",value:z},{name:"Damara",value:z},{name:"Náma",value:x},{name:"Capriviané",value:"4 %"},{name:"Basters",value:A},{name:"Sanové",value:A},{name:"Wambové",value:y},{name:"Jiné",value:"10 %"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným dokladem pro vstup do Namibie. Pro vstup je nutné mít platný cestovní pas.",date_update:d},{name:"Cestovní pas",value:"Pro vstup do Namibie je nutné mít platný cestovní pas s platností minimálně 6 měsíců od data příjezdu.",date_update:d},{name:"Vízum",value:"Pro občany České republiky (EU) není potřeba víza pro pobyt kratší než 90 dnů. Pro delší pobyt je nutné požádat o vízum. Pokud je pobyt delší než 90 dnů, je nutné registrovat se na Ministerstvu vnitra během prvních 90 dnů pobytu.",date_update:d},{name:"Očkování",value:"Při vstupu do Namibie nejsou nutná žádná očkování. Nicméně jsou doporučována očkování proti hepatitidě A a B a tetanu.",date_update:d},{name:"Cestovní pojištění",value:"Při vstupu do Namibie není nutné mít cestovní pojištění, ale je velmi doporučeno, zejména pokud plánujete cestovat mimo větší města a turistické oblasti. Vzhledem k tomu, že zdravotní péče v Namibii může být velmi drahá, je dobré mít kvalitní zdravotní pojištění s krytím případného transportu do nemocnice v případě potřeby.",date_update:d},{name:"Bezpečností situace",value:"Namibie je obecně považována za bezpečnou zemi, avšak jako všude na světě, i zde může dojít ke krádežím a dalším drobným kriminalitěm. V některých oblastech Namibie mohou být přítomni divocí zvířata a je třeba dodržovat všechna varování a zásady bezpečnosti. Vzhledem k občasné přítomnosti silného větru a prachu, je vhodné mít s sebou ochranné brýle a šátek na ústa.",date_update:d},{name:"Další informace",value:"V Namibii je běžně používána hotovost v Namibijských dolarech a v některých turistických oblastech také v eurech. Vzhledem k tomu, že se jedná o rozlehlou zemi, je vhodné plánovat si cestování dopředu a připravit se na delší přesuny. Při cestování mimo větší města a turistické oblasti je vhodné mít s sebou dostatek zásob vody a jídla.",date_update:d}],type_place:g,id_image_cover:r,id_image_hero:r,id_city_main:s,affiliate:[{name:B,value:b}],mpz:"NA",alerts:a,zoom:[{google:h,booking:h}],ids_neighboring_countries:[{id:n},{id:q},{id:C},{id:D}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:E,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"NAD",name:"namibijský dolar"}],setting_top:b,setting_status_public:m}],imagePlace:[{id:r,name:v,source:j,type:g,author:k,created_at:F,updated_at:l}],placesStatesNeighboring:[{id:D,id_image_cover:G,slug:H,type_place:g,name:"Zambie"},{id:C,id_image_cover:I,slug:J,type_place:g,name:"Jihoafrická republika"},{id:q,id_image_cover:K,slug:L,type_place:g,name:"Botswana"},{id:n,id_image_cover:p,slug:M,type_place:g,name:"Angola"}],imagesStatesNeighboring:[{id:G,name:H,source:j,type:g,author:k,created_at:"2023-05-04T07:17:51.463854+00:00",updated_at:l},{id:I,name:J,source:j,type:g,author:k,created_at:F,updated_at:l},{id:K,name:L,source:j,type:g,author:k,created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:l},{id:p,name:M,source:j,type:g,author:k,created_at:"2023-04-10T23:51:59.681083+00:00",updated_at:l}],placeContinent:[{id:h,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:h,id_image_hero:h,zoom:[{google:u,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:N,date_update:N,author_create:O,author_update:O}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:b,setting_status_public:m}],placesCities:[{id:1574,id_image_cover:a,importance:e,slug:"grootfontein",type_place:f,name:"Grootfontein"},{id:1573,id_image_cover:a,importance:e,slug:"katima-mulilo",type_place:f,name:"Katima Mulilo"},{id:1577,id_image_cover:a,importance:e,slug:"keetmanshoop",type_place:f,name:"Keetmanshoop"},{id:1571,id_image_cover:a,importance:e,slug:"oshakati",type_place:f,name:"Oshakati"},{id:1576,id_image_cover:a,importance:e,slug:"otjiwarongo",type_place:f,name:"Otjiwarongo"},{id:1575,id_image_cover:a,importance:e,slug:"rehoboth",type_place:f,name:"Rehoboth"},{id:1569,id_image_cover:a,importance:e,slug:"rundu",type_place:f,name:"Rundu"},{id:1572,id_image_cover:a,importance:e,slug:"swakopmund",type_place:f,name:"Swakopmund"},{id:1570,id_image_cover:a,importance:e,slug:"walvis-bay",type_place:f,name:"Walvis Bay"},{id:s,id_image_cover:a,importance:e,slug:P,type_place:f,name:Q}],imagesCities:a,placeCityMain:[{id:s,id_state:E,name:Q,population:431000,area:645,altitude:1654,slug:P,information_chatgpt:"\u003Cp\u003EWindhoek, hlavní město Namibie, je fascinujícím spojením moderní architektury a africké kultury. Město je domovem různorodé populace, kde se střetávají různé etnické skupiny, jako jsou Nama, Herero a Ovambo.\u003C\u002Fp\u003E\n\u003Cp\u003EJedním z významných symbolů Windhoeku je Christuskirche, gotický luteránský kostel postavený v 20. století německými kolonizátory. V historickém centru města naleznete Tintenpalast, což je sídlo namibijského parlamentu, s okouzlujícím německým architektonickým vlivem.\u003C\u002Fp\u003E\n\u003Cp\u003EPro milovníky umění a kultury je tu Národní muzeum Namibie, kde můžete objevit bohatou historii a tradice této fascinující země. Naopak trh Craft Centre nabízí autentické řemeslné výrobky místních umělců, perfektní suvenýry z cesty.\u003C\u002Fp\u003E\n\u003Cp\u003EWindhoek je známý svou pestrým gastronomickým světem. Vyzkoušejte tradiční namibijská jídla jako je biltong (sušené maso) a kapana (grilované maso), které můžete ochutnat v místních restauracích.\u003C\u002Fp\u003E\n\u003Cp\u003ENepřehlédněte také okolní přírodní krásy.  Příznivci outdoorových aktivit mohou podniknout výlety do nedalekého Národního parku Daan Viljoen, kde mohou obdivovat africkou faunu a flóru.\u003C\u002Fp\u003E\n\u003Cp\u003EWindhoek je takovým křižovatkou minulosti a současnosti, kde se snoubí různé kultury a historie, což z něj činí zajímavý cíl pro cestovatele hledající jedinečný pohled na Namibii.\u003C\u002Fp\u003E",coordinates:[{latitude:-22.57,longitude:17.0836}],biggest:"yes",type_place:f,id_image_cover:a,id_image_hero:a,affiliate:[{name:B,value:b}],alerts:a,zoom:[{google:o,booking:11}],parking:a,information_author:a,importance:e,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-04T19:48:29.85915+00:00",name_original:a,setting_top:b,setting_status_public:m}],imageCityMain:a}],fetch:{"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,true,"09-2021","05-2023","biggest","city","state",5,0,"\u002Fworld\u002Fstates\u002F","pixabay.com","2023-12-27T20:42:18.520959+00:00",1,8,10,15,35,323,1568,4,2,"namibie","112","5 %","2 %","7 %","3 %","booking",247,248,160,"2023-05-03T20:14:00.749527+00:00",391,"zambie",278,"jihoafricka-republika",225,"botswana","angola","2024-03-01","1","windhoek","Windhoek")));